import React from "react";
import classes from "./Loader.module.css";

const Loader = props => (
    <div
        style={{
            borderLeft: props.mainColor,
            borderTop: props.shadow,
            borderBottom: props.shadow,
            borderRight: props.shadow,
        }}
        className={classes.Loader}
    ></div>
);

export default Loader;
